import logo from './images/consumer-action-white.png'
import './App.css';

function App() {
  return (
    <div>
      <img src={logo} alt="logo" />
      <div className="video-container">
        <div className="video-inner">
          <iframe width="550" height="275" src="https://www.youtube.com/embed/l0onSbsfvCI" frameBorder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowFullScreen></iframe>
        </div>
      </div>
    </div>
  )
}

export default App;
